The midpoint of the line segment connecting Annie's and Barbara's initial positions will be equidistant from both, forming the shortest path to Charlie's location. 

Let the midpoint be $(x, y)$. Then, we have the equations:
\begin{align*}
\frac{6+1}{2} &= x \\
\frac{-20+14}{2} &= y
\end{align*}
Solving, we find that the midpoint is $(\frac{7}{2}, -3)$.

Now, to find how many units upward Annie and Barbara will walk together, we need to calculate the vertical distance from the midpoint to Charlie's location:
\begin{align*}
2 - (-3) &= 5
\end{align*}
Therefore, Annie and Barbara will walk $\boxed{5}$ units upward together to get to Charlie.

