To find the points of intersection, we set the two equations equal to each other:

\begin{align*}
3 &= 4x^2 + x - 1 \\
0 &= 4x^2 + x - 4
\end{align*}

Now we can use the quadratic formula to solve for $x$:

\begin{align*}
x &= \frac{-b \pm \sqrt{b^2 - 4ac}}{2a} \\
x &= \frac{-1 \pm \sqrt{1 + 64}}{8} \\
x &= \frac{-1 \pm \sqrt{65}}{8}
\end{align*}

So the $x$ coordinates of points $A$ and $B$ are $\frac{-1 + \sqrt{65}}{8}$ and $\frac{-1 - \sqrt{65}}{8}$, respectively. The distance between these two points can be found by taking the absolute difference of their $x$ values:

\begin{align*}
\left| \frac{-1 + \sqrt{65}}{8} - \frac{-1 - \sqrt{65}}{8} \right| &= \left| \frac{2\sqrt{65}}{8} \right| \\
&= \frac{\sqrt{65}}{4}
\end{align*}

Therefore, $m - n = \boxed{65 - 4 = 61}$.

